echo 'Encryption: ' . PHP_EOL;

$str = 'if man was meant to stay on the ground god would have given us roots';
$str = 'chillout';

$encryption = new Encryption();
echo $encryption->encrypt($str);

echo 'Bracket check 1:' . PHP_EOL;
    $bracketCheck = new BracketCheckImplementationOne();
    foreach ($strList as $str) {
        $res = $bracketCheck->check($str);
        echo sprintf('%s => %s', $str, $res === true ? 'YES' : 'NO') . PHP_EOL;
    }

echo 'Bracket check 2:' . PHP_EOL;
$bracketCheck = new BracketCheckImplementationTwo();
foreach ($strList as $str) {
    $res = $bracketCheck->check($str);
    echo sprintf('%s => %s', $str, $res === true ? 'YES' : 'NO') . PHP_EOL;
}

echo 'Greedy Florist:' . PHP_EOL;
$greedyFlorist = new GreedyFlorist(3, [6, 2, 5]);
echo sprintf('3 friends, 3 flowers, cost [6, 2, 5]; sum: %s', $greedyFlorist ->calculate());

